978]],[logseq____&quot;^15logseq____&quot;,[1090,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;### Amie Longstride\\n\\nAge: 21\\nHeight: 171 cm\\nWeight: 69 kg\\nRace: Wood-elf\\n\\n![Amie picture](https://cdn.discordapp.com/attachments/1030158179310506095/1035425841728983130/Elf.jpg){:height 497, :width 361}\\n\\nHår: Langt brunt som er krøllet ned til skuldrene\\nØjne: Grønne som mørk emerald\\nSkin: Lys brunt, glat og velholdt med et enkelt ar på højre inderlår på 2 cm.\\n\\nAmie voksede op i skovene blandt andre elvere og hendes folk og havde en normal barndom, hvert år når man fylder 18 så som mange andre skal man deltage i begivenheden \\logseq____&quot;Allocate\\logseq____&quot; som finder sted hvert år.\\nEn af byens ældre vælger ud fra opvækst og opførsel et individ som skal allokeres som betyder man skal ud på en rejse med en af de voksne mentorer.\\n\\nDette år blev Amie valgt og skulle have [[Osty]] som mentor.\\nDe tog op mod bjergene og årene gik.\\n\\nAmie fik sit første sjæle-bånd, til et flyveegern som fik navnet [[Oliver]] \\nOliver blev brugt til at holde kontakten til Amielogseq____&apos;s forældre imens hun blev allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[1090,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536870978]],[logseq____&quot;^15logseq____&quot;,[1090,logseq____&quot;^Flogseq__ lydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Flogseq____&quot;,1439,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Xlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Vlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Ulogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Jlogseq____&quot;,[],536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^Hlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1433,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66c77859-378e-4ed0-b899-0f943400ea68logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Flogseq____&quot;,1441,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Xlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Vlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^Ulogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1434,logseq____&quot;^;logseq____&quot;,logseq____&quot  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // ----------------------------------------------------------------------
      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
